import { useState } from 'react'

function Home() {
    return <div>Home OK</div>
}

function Contador() {
    const [contador, setContador] = useState()
    return (
        <div>
            <div>{contador}</div>
            <button onClick={adicionarContador}>Adicionar</button>
        </div>
    )
}

export default Home
